import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGlobe } from '@fortawesome/free-solid-svg-icons';
import './navbar.css';

function Navbar() {
  const [isOpen, setIsOpen] = useState(false); // State to manage menu visibility
  const [isSliderOpen, setIsSliderOpen] = useState(false); // State to manage slider visibility

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  const toggleSlider = () => {
    setIsSliderOpen(!isSliderOpen);
  };

  return (
    <nav className="navbar">
      <div className="navbar-header">
        <div className="navbar-logo">
          <h1>Business Solution</h1>
        </div>
        <div className="navbar1">
          <button className="toggle-button" onClick={toggleMenu}>
            â˜° {/* Hamburger icon for navbar1 */}
          </button>
          <ul className={`navbar-menu ${isOpen ? 'open' : ''}`}>
            <li>Driver</li>
            <li>Rider</li>
            <li>Business</li>
            <li>Log in</li>
            <li>Sign up</li>
            <li><FontAwesomeIcon icon={faGlobe} /> En</li>
          </ul>
          <button className="toggle-slider" onClick={toggleSlider}>
            &#x21C6; {/* Slider toggle icon */}
          </button>
        </div>
      </div>

      {/* Slider for Navbar2 */}
      <div className={`slider ${isSliderOpen ? 'open' : ''}`}>
        <ul className="slider-menu">
          <li>Products</li>
          <li>Solutions</li>
          <li>Customers</li>
          <li>Resources</li>
          <li>Contact us</li>
          <li>Get started</li>
        </ul>
      </div>

      {/* Navbar2 is always visible */}
      <div className="navbar2">
        <ul className="navbar-menu2">
          <li>Products</li>
          <li>Solutions</li>
          <li>Customers</li>
          <li>Resources</li>
          <li>Contact us</li>
          <li>Get started</li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
